import React from "react";
import Nav from "./components/Nav";
import Router from "./components/Router";
import Dashboard from "./components/Dashboard";
import Footer from "./components/Footer";
import "./App.scss";

function App() {
  return (
    <div className='App'>
      <Nav />
      <Router />
      <Dashboard />
      <Footer />
    </div>
  );
}
export default App;
